import { Button, Control, Input } from "react-bulma-components";

function BookForm() {
  return (
    <div>
      <p>teste form</p>
      <Button>Book button</Button>
      <Control>
        <Input></Input>
      </Control>
    </div>
  );
}

export default BookForm;
